                pub fn process_syscall_request(&mut self,
                                               mips_state: MipsState,
                                               required_type: ReadSyscalls)
                 -> bool {
                    match &*self.state.borrow_mut() {
                        State::Running(curr) => {
                            curr.borrow_mut().mips_state = mips_state;
                            curr.borrow_mut().input_needed =
                                Some(required_type);
                            self.focus_input();
                            true
                        }
                        State::NoFile | State::CompilerError(_) => false,
                    }
                }
                fn focus_input(&self) {
                    if let Some(input) =
                           self.input_ref.cast::<HtmlInputElement>() {
                        input.set_disabled(false);
                        input.focus().unwrap();
                    };
                }
                pub fn process_syscall_response(&mut self,
                                                input: HtmlInputElement,
                                                required_type:
                                                    ReadSyscallInputs) {
                    match &*self.state.borrow_mut() {
                        State::Running(curr) => {
                            self.worker.send(WorkerRequest::GiveSyscallValue(curr.borrow_mut().mips_state.clone(),
                                                                             required_type));
                            curr.borrow_mut().input_needed = None;
                            input.set_value("");
                            input.set_disabled(true);
                        }
                        State::NoFile | State::CompilerError(_) => {
                            {
                                let lvl = ::log::Level::Error;
                                if lvl <= ::log::STATIC_MAX_LEVEL &&
                                       lvl <= ::log::max_level() {
                                    ::log::__private_api_log(::core::fmt::Arguments::new_v1(&["Should not be possible to give syscall value with no file"],
                                                                                            &match ()
                                                                                                 {
                                                                                                 _args
                                                                                                 =>
                                                                                                 [],
                                                                                             }),
                                                             lvl,
                                                             &("mipsy_web::pages::main::app",
                                                               "mipsy_web::pages::main::app",
                                                               "crates/mipsy_web/src/pages/main/app.rs",
                                                               407u32));
                                }
                            };
                        }
                    }
                }
